import React from 'react';
import Search_box from '../elements/search_box';

class Home extends React.Component {
  render() {
    return(
      <div>
        <header></header>
        <nav  id="nav">&nbsp;</nav>
        <div id="section">
          <Search_box/>
        </div>
        <aside id="aside"></aside>
        <footer></footer>
      </div>
    )
  }
}

export default Home
